import React from "react";
import Link from "next/link";
import Router from "next/router";

const mainIndex = ()=>(
  <div>
  <div><h1>The Main index page</h1></div>
  <Link href="/Auth"><a>Auth</a></Link>
  <button onClick={()=>{
     Router.push("/Auth")
  }}>Go to Auth</button>
  </div>
)


export default mainIndex;
